import React from "react"
import { RiCloseCircleFill } from "react-icons/ri"

const AuditorSelectorItem = ({ text = "Fiscal Responsável", disabled = false, close = undefined, ...restProps }) => {
    return (
        <div className="tag">                       
            <span className="p-2 border bg-light">
                {text}
                {!disabled &&
                    <RiCloseCircleFill 
                        style={{cursor: "pointer", color: "#51cbce", marginLeft: "3px"}}
                        onClick={close}
                    />
                }
            </span>
        </div>
    );
};


export default AuditorSelectorItem;
